import './card.css';
const card = ({ name = "rakib", age = 18 }) => {
    return (
        <div className="main_box">
            <img src = "//joeschmoe.io/api/v1/{name}" alt="avatar" />
            <h1>{name}</h1>
            <p>Age: {age}</p>
        </div>
    );
}
export default card;
